import axios from "axios";
const baseURL = "http://localhost:5000";

// const api = axios.create({
//   baseURL,
// });

// axios
//   .get(baseURL)
//   .then((res) => console.log(res))
//   .catch((error) => console.log(error));

const registerUser = (user) => {
  axios
    .post(baseURL + "/auth/registration", { ...user })
    .then((res) => console.log(res))
    .catch((error) => console.log(error));
};
export { registerUser };
